                {
                    [1] = "GUILD:;An Fiach Dubh;Campaign \"Thornblade\";It's pronounced An Fee-Och Dove;4/8/2014;12;EU Megaserver;@Heppy;1;",
                    [2] = "GUILD:;Tamriels Emporium;1) WTB/WTS/WTT in guildchat is NOT allowed.\r\n\n 2) Donations will be counted towards Donor Rank progression and encouraged to help the weekly Trader bids.\r\n\n 3) 5-day inactivity limit.;Welcome to Tamriels Emporium Trading guild!\n\nhttps://discord.gg/HXqB7qA\n\nTONIGHT is the weekly TRADER BID. All possible DONATIONS go a long way in sustaining our trader, especially with the new housing patch!\n\nTo celebrate we will be encorporating a LOTTERY system to reward guild members with new luxuary items to use or sell at their leisure! More details will be announced via guild wide mails so keep your inboxes clean to receive them :P\n\nThis week our trader can be found at NEVLON GALEN in BELKARTH CRAGLORN.\n\nPlease fill your 30 slots with desireable items and price them SENSIBLY. Our trader is now open to the whole of Tamriel!\n\nTop 5 Traders of the Week!\n\n1) @HSVFAN\n2) @Robbels\n3) @Pavlovich.corp\n4) @Cr3wniau\n5) @Chaos_Director\n\nRanks (weekly)\nTrader  < 50K Sales\nAdvanced Trader - 50K+ Sales\nVeteran Trader - 100K+ Sales\nElite Trader - 500K+ Sales\n\nRanks (permanent)\nDonor - 10K+ Donation\nVeteran Donor - 100K+ Donation\nElite Donor 1M+ Donation;5/4/2016;498;EU Megaserver;@Heppy;2;",
                    [3] = "GUILD:;Traders of the Covenant;1. Use MasterMerchant Addon\n2. EVERYONE can INVITE (veterans) \n3. English only & No immature behaviour\n4. INACTIVE 5days/not selling in TRADER = KICK. (Msg. if away longer)\n5. Support the guild by DONATING gold (for trader)\n6. Dont sell under 50g;~|cFF8174Guild House|r~\n travel to Balastar's residence. \n\n~|cFF8174LOTTO|r~\nPrizes:\n1. |c9F00FF[RaGada belts Motif]|r +mat\n2. [Hakeijo] + |cFFC600[Kuta]|r\n3. |c9F00FF[Celestial Swords, Staves + Maces Motif]|r +mats\n\nAll deposits in Guild Bank participates in lotto. 2k = ticket. You can buy as many you want. :) Lotto draw on Sun 19 CET.\r\n\nDonation of 20k+ gives you rank |c4592FFNoble|r + access to the Guild Bank. Rank is 1 month but by continous donations you keep it. Please don’t exploit Guild Bank.\r\n\nThanks for your support! <3\n\r\n~|cFF8174Alliance|r~\r\nPart of Tamriel Trade Union, Master Traders welcome to contact @Ireniicus(TTG) @Xylia(TM) for other Top trade guilds in prime locations.\n\n~|cFF8174Services|r~\r\nTS3: ts.totc.eu\nMail return: Mail @Balastar with subject /r \n\nHave a nice week and happy trading,\r\nTaz\r;3/20/2015;500;EU Megaserver;@Heppy;3;",
                    [4] = "GUILD:;Vanheim;|cffffffGrundad i Aldmeri Dominion - florad i hela Tamriel!\nDitt ljus i MMO-MÖRKRET - där nöje och gemenskap kommer före elitism. Likt vargar håller vi ihop i både vått och torrt - tillsammans kan vi!\n\nVälkommen till Vanheim!|r;|cFFFFFF***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***|r\n|cFFFFFFTisdag 20:00-22:00: Dungeon Event - Monster Helms, Set items & EXP!|r\n|cFFFFFFTorsdag 20:00 (20:15): AvA Event - Delves, Skyshards, Dolmens & PvP!|r\n|cFFFFFFDaily 18:00-22:00: Normal & Veteran Pledges - Undaunted Keys!|r\n\n|cFFFFFF***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***   ***|r\n|cFFFFFFAnvänd gärna Guildbanken. Kolla eventuella dubletter innan! En symbolisk \"Ge & Ta\" moral är det som gäller.|r;8/6/2016;68;EU Megaserver;@Heppy;4;",
